import React from 'react';

const Auth = () => {
    return (
        <div>
            <div>
                <img className="w-32 h-32" src="/images/logo.png" alt="" />
            </div>
            <h1 className="text-black">Login</h1>
        </div>
    );
};

export default Auth;
